value.css:
padding: 1rem 0;

.menu {
  display: flex;
  flex-direction: column;
	align-items: center;
  justify-content: space-between;
  width: 100%;

  .logo {
    font-weight: 600;
    display: flex;
    align-items: center;

    img {
    	max-width: 10rem;
    }
  }

  nav {
    display: flex;
    justify-content: center;
    margin: 1rem 0;
    ul {
      display: flex;
      justify-content: center;
      align-items: center;
      li {
        a {
          font-weight: 600;
          margin-left: 2rem;
					text-decoration: underline transparent;
          &:hover {
            text-decoration-color: var(--color-accent, #222);
          }
        }
      }
    }
  }

  .right {
    display: flex;
    justify-content: flex-end;
    align-items: center;

    .social-link {
      padding-right: 1rem;
      font-size: 1.5rem;

      i:hover {
        color: var(--color-accent);
      }
    }

    .cta {
      display: block;
      padding: 0.5rem 1rem;
      border: 1px solid var(--color-accent);
      border-radius: 0.25rem;

      &:hover {
        color: white;
        background: var(--color-accent);
      }
    }
  }
}

.tabs {
  position: relative;

  .primary {
    display: flex;
    margin: 0 1rem;
  }
}

@media (min-width: 900px) {
  header {
    .menu {
			flex-direction: row;

      nav {
        margin: 0;
      }
    }
  }
}

--verydarkgray: #222222;

header {
  padding: 10rem 0;
  background: center / cover no-repeat;
  background-color: rgba(10, 10, 10, .8);
  background-blend-mode: multiply;
  text-align: center;
  color: white;

  .container {
    .heading {
      font-size: 2rem;
      font-weight: 600;
      line-height: 1.2;
      margin-bottom: 1rem;
    }
    .subheading {
      font-size: 1.25rem;
    }
    .links {
      padding: 1rem;
      max-width: 600px;
      margin: 0 auto;
      margin-top: 1rem;
      .button {
        display: inline-block;
        margin: 1rem;
        text-transform: uppercase;
        background-color: white;
        color: var(--verydarkgray);
        font-family: var(--display-font);
        font-weight: 700;
        font-size: 1rem;
        letter-spacing: 0.2625rem;
        padding: 1rem 2rem;
        border-radius: 2rem;

        &:hover {
          color: white;
          background: var(--color-accent);
        }
      }
    }
  }
}

@media (min-width: 600px) {
  header {
    .container {
      .heading {
        font-size: 3rem;
      }
      .subheading {
      	font-size: 1.5rem;
      }
      .links {
        grid-template-columns: repeat( auto-fill, minmax(250px, auto) );
      }
    }
  }
}

padding: 3rem 0;

section {
  display: grid;
  grid-template-columns: 1fr 1fr 1fr;
  grid-gap: 2rem;

  .card {
    background: white;
		border: 1px solid gainsboro;

    img {
      height: 15rem;
    	width: 100%;
    	object-fit: cover;
    	object-position: center;
    }

    .body {
      padding: 2rem;

      .title {
        font-weight: 600;
        font-size: 1.5rem;
      }

      .subtitle {

      }
    }
  }
}

@media (max-width: 600px) {
  section {
  	grid-template-columns: 1fr;

    .card {
      img {
				height: 10rem;
      }
    }
  }
}

padding: 3rem 0;

section {

  .images {
    display: grid;
    grid-template-columns: 1fr 1fr 1fr;
    grid-gap: 2rem;

    img {
    	width: 100%;
    	object-fit: contain;
    	object-position: center;
    }

    .body {
      padding: 2rem;

      .title {
        font-weight: 600;
        font-size: 1.5rem;
      }

      .subtitle {

      }
    }
  }
}

@media (max-width: 600px) {
  section {
  	.images {
    	grid-template-columns: 1fr;
    }
  }
}

padding: 3rem 0;

section {
  display: grid;
  grid-template-columns: 1fr;

  .events {
    display: grid;
    grid-template-columns: 1fr;
    grid-gap: 3rem;
    margin-bottom: 2rem;

    .item {
      dt {
        font-size: 1.75rem;
        line-height: 1.1;
        margin-bottom: 1rem;
        font-weight: 500;
      }
      dd {
        margin-bottom: 1rem;
        .date {
          font-size: 1.25rem;
          font-weight: 500;

          span {
            display: block;
          }
        }

        .location {
          filter: brightness(1.5);
        }
      }

      a {
        border: 2px solid var(--color-accent);
        padding: 0.5rem 1rem;
        display: inline-block;

        &:hover {
          color: white;
          background: var(--color-accent);
        }
      }

      &:not(:last-child) {
        border-bottom: 1px solid #eee;
        padding-bottom: 3rem;
      }
    }
  }

  .call-to-action {
    justify-self: end;
    font-size: 1.5rem;
    text-decoration: underline #222;
    &:hover {
      text-decoration-color: transparent;
    }
  }
}

@media (min-width: 900px) {
  section {

    .events {
    	grid-template-columns: 1fr 1fr 1fr;

      .item {
        border-bottom: 0 !important;
        padding-bottom: 0 !important;
      }
    }
  }
}

padding: 3rem 0;
border-top: 1px solid #eee;
border-bottom: 1px solid #eee;

section {
  .heading {
    font-size: 2.5rem;
    font-weight: 600;
    margin-bottom: 1.5rem;
    text-align: center;
  }

  .images {
    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));

    img {
      padding: 2rem;
      align-self: center;
      filter: grayscale(2);
      object-fit: contain;
      object-position: center;
      align-self: center;
      justify-self: center;
    }
  }
}

@media (max-width: 600px) {
  section {
    .images {
      grid-template-columns: 1fr;
    }
  }
}

background-color: #eee;	
padding: 2rem 0;
transition: color 0.1s, opacity 0.1s;

footer {

  .logo img {
    display: inline-block;
    width: 100%;
    max-width: 10rem;
    margin-bottom: 1rem;
  }

  .primo {
    font-size: 0.75rem;
    font-weight: bold;
    &:hover { color:rgb(248,68,73) }
  }

  .content {
    display: grid;
    grid-template-columns: 1fr;
    gap: 2rem;
    .icon-item {
      display: flex;
      align-items: center;
      flex-wrap: wrap;
      font-weight: 600;

      i {
        margin-right: 0.5rem;
      }
    }
    & > div {
      :is(h1, h2, h3, h4, h5, h6) {
        font-weight: 600;
        font-size: 1.25rem;
        margin-bottom: 0.25rem;
      }
    }
    .link-list {
      a {
        text-decoration: underline;
      }
    }
  }

  .sub-footer {
    display: flex;
    justify-content: space-between;
    align-items: center;
    border-top: 1px solid #ddd;
    margin-top: 2rem;
    padding-top: 2rem;

    .social {
      display: flex;
      flex-direction: column;

      span {
        margin-right: 1rem;
        font-weight: 600;
      }

      ul {
        display: flex;

        li a {
      		font-size: 1.5rem;
          margin-right: 0.75rem;

          &:hover {
            opacity: 0.75;
          }
        }
      }
    }
  }
}

@media (min-width: 600px) {
  footer {
    .content {
      grid-template-columns: 2fr 1fr 1fr;
    }
    .sub-footer .social {
      flex-direction: row;
      align-items: center;
    }
  }
}

