--verydarkgray: #222222;

background-color: rgba(10, 10, 10, .8);
color: white;
padding: 5rem 0;
position: relative;

header {
  background-blend-mode: multiply;
  z-index: 1;
  position: relative;

  .heading {
    font-size: 2rem;
    font-weight: 600;
    line-height: 1.2;
    margin-bottom: 1rem;
  }
  .subheading {
    font-size: 1.25rem;
  }
