img {
  opacity: 1;
  position: absolute;
  inset: 0;
  height: 100%;
  width: 100%;
  z-index: 0;
  mix-blend-mode: darken;
  object-fit: cover;
}

padding: 4rem 0;

ul {
  li {
    display: grid;
    grid-template-columns: 1fr 1fr;
    gap: 4rem;
    place-items: center;
    figure {
      grid-column: 1 / 3;
      grid-row: 1;
      display: grid;
      grid-template-columns: auto 4rem auto;
      grid-template-rows: auto 8rem auto;

      img {
        width: 100%;
        object-fit: cover;
        border-radius: 1rem;
        grid-column: 1 / 3;
        grid-row: 1 / 3;
        z-index: 1;
      }

      img:nth-child(2) {
        grid-column: 2 / 4;
        grid-row: 2 / 4;
        z-index: 2;
      }
    }
    .content {
      grid-column: 1 / 3;

      .body {
        margin-bottom: 1.5rem;
      }
      .button {
        background: var(--color-accent);
        color: white;
        padding: 1rem 2rem;
        border-radius: 5rem;
        display: inline-block;
      }
    }
  }
  li:nth-child(even) {
    figure {
      img:first-child {
        grid-column: 2 / 4;
      }

      img:nth-child(2) {
        grid-column: 1 / 3;
      }
    }
  }
  li:not(:last-child) {
    padding-bottom: 5rem;
    margin-bottom: 4rem;
    border-bottom: 1px solid #eee;
  }
}

@media (min-width: 600px) {
  ul {
    li {
      grid-template-columns: 1fr 1fr;

      figure {
      	grid-column: 1;
      }
      .content {
      	grid-column: 2;
      }
    }
    li:nth-child(even) {
      figure {
        grid-column: 2;

        img:first-child {
          grid-column: 2 / 4;
        }

        img:nth-child(2) {
          grid-column: 1 / 3;
        }
      }
      .content {
        grid-column: 1;
      }
    }
  }
}

--color-accent: gainsboro;
--font-size-date: 1.3rem;
--font-size-description: 1rem;
--box-max-width: 300px;

padding: 3rem 0;

main {
  .heading {
    text-align: center;
  }

  .timeline {
    & > div {
      display: grid;
      grid-template-columns: 1fr 20px 1fr;
      place-items: stretch;
      gap: 1rem;
      padding-bottom: 1rem;
    	position: relative;

      .description {
        font-size: var(--font-size-description, 2rem);
        grid-column: 1;
        grid-row: 1;
        position: relative;
        max-width: var(--box-max-width, 500px);
        place-self: end;

        span {
          padding: 1rem;
          display: inline-block;
        	background: var(--color-accent);	
        }

        /* triangle */
        &:after {
          content: '';
          width: 0; 
          height: 0; 
          top: calc(50% - 5px);
          border-top: 5px solid transparent;
          border-bottom: 5px solid transparent;
          border-left: 5px solid var(--color-accent);
          position: absolute;
        }
      }

      svg {
        grid-column: 2;
        grid-row: 1;
      }
      .date {
        font-size: var(--font-size-date, 1rem);
        font-weight: 700;
        display: flex;
  			align-items: center;
      }

    	/* vertical line */
    	&:after {
        content: '';
        height: 100%;
        width: 2px;
        background: var(--color-accent);
        position: absolute;
        left: calc(50% - 2px);
        z-index: -1;
      }

      &:nth-child(even) {
        .description {
        	grid-column: 3;
        	text-align: left;
	        place-self: start;

          &:after {
            right: 100%;
            border-left: 0;
            border-right: 5px solid var(--color-accent);
          }
        }
        .date {
          grid-column: 1;
					place-self: end;
          align-self: center;
        }
      }

    	&:first-child {
        &:after {
          top: 50%;
        }
      }
    	&:last-child {
        &:after {
          bottom: 50%;
        }
      }
    }
  }
}

padding: 3rem 0;

section {
  .heading {
    text-align: center;
  }
  .cards {
    display: grid;
    grid-template-columns: auto;
    grid-gap: 2rem;

    .card {
      border: 1px solid #eee;
      border-radius: 1rem;
      overflow:hidden;
  		position: relative;
      background: white;

      &:hover {
        text-decoration-color: #222;

        .title {
      		text-decoration: underline transparent;
        }
      }

      img {
      	width: 100%;
      	object-fit: cover;
      	object-position: center;
      }

      .body {
        padding: 1.5rem;

        .title {
          text-decoration-color: var(--color-accent);
          font-weight: 600;
          font-size: 1.25rem;
        }
      }
    }
  }
}

@media (min-width: 600px) {
  section {
    .cards {
    	grid-template-columns: 1fr 1fr 1fr;

      .card {
        img {
  				height: 20rem;
        }
      }
    }
  }
}

background-color: #eee;	
padding: 2rem 0;
transition: color 0.1s, opacity 0.1s;

footer {

  .logo img {
    display: inline-block;
    width: 100%;
    max-width: 10rem;
    margin-bottom: 1rem;
  }

  .primo {
    font-size: 0.75rem;
    font-weight: bold;
    &:hover { color:rgb(248,68,73) }
  }

  .content {
    display: grid;
    grid-template-columns: 1fr;
    gap: 2rem;
    .icon-item {
      display: flex;
      align-items: center;
      flex-wrap: wrap;
      font-weight: 600;

      i {
        margin-right: 0.5rem;
      }
    }
    & > div {
      :is(h1, h2, h3, h4, h5, h6) {
        font-weight: 600;
        font-size: 1.25rem;
        margin-bottom: 0.25rem;
      }
    }
    .link-list {
      a {
        text-decoration: underline;
      }
    }
  }

  .sub-footer {
    display: flex;
    justify-content: space-between;
    align-items: center;
    border-top: 1px solid #ddd;
    margin-top: 2rem;
    padding-top: 2rem;

    .social {
      display: flex;
      flex-direction: column;

      span {
        margin-right: 1rem;
        font-weight: 600;
      }

      ul {
        display: flex;

        li a {
      		font-size: 1.5rem;
          margin-right: 0.75rem;

          &:hover {
            opacity: 0.75;
          }
        }
      }
    }
  }
}

@media (min-width: 600px) {
  footer {
    .content {
      grid-template-columns: 2fr 1fr 1fr;
    }
    .sub-footer .social {
      flex-direction: row;
      align-items: center;
    }
  }
}

