--color-bg: #D51E49;
--color-bg--dark: darken(var(--color-bg), 7%);
--color-bg--darker: darken(var(--color-bg), 14%);

--color-text: #FAF3DD;

.menu {
  display: flex;
  justify-content: space-between;
  width: 100%;

  .logo {
    font-weight: 600;
    background: gainsboro;
    padding: 0 2rem;
    flex: 1;
    display: flex;
    align-items: center;
  }
}


.tabs {
  position: relative;

  .hidden {
    display: none;
  }

  &:not(.--jsfied) {
    overflow: auto;
    -webkit-overflow-scrolling: touch;
  }

  a,
  button {
    width: 100%;
    height: 100%;
    display: block;
    font-size: 1em;
    line-height: 1.2;
    text-align: center;
    color: var(--color-text);
    background-color: var(--color-bg);
  }

  .primary {
    display: flex;
    flex: 1;

    & > li {
      flex-grow: 1;
      background-color: var(--color-bg);

      & + li {
        border-left: 1px solid var(--color-bg--dark);
      }

      & > a,
      & > button {
        white-space: nowrap;
        padding: 1em 0.6em;
        box-shadow: inset 0 -0.2em 0 var(--color-bg--dark);
      }
    }

    .more {
      background-color: var(--color-bg--dark);

      & > button span {
        display: inline-block;
        transition: transform 0.2s;
      }
    }
  }

  .secondary {
    max-width: 100%;
    min-width: 10em;
    display: none;
    position: absolute;
    top: 100%;
    right: 0;
    box-shadow: 0 0.3em 0.5em rgba(#000, 0.3);
    animation: nav-secondary 0.2s;

    li {      
      border-top: 1px solid var(--color-bg);
      background-color: var(--color-bg--dark);
    }

  }
}

.show-secondary .secondary {
  display: block;
}
.show-secondary .primary {
  .more > button span {
    transform: rotate(180deg);
  }
}

@keyframes nav-secondary {
  0% {
    opacity: 0;
    transform: translateY(-1em);
  }
  100% {
    opacity: 1;
    transform: translateY(0);
  }
}

