padding: 3rem 0;

main {
  .heading {
    text-align: center;
  }

  .timeline {
    & > div {
      display: grid;
      grid-template-columns: 1fr 20px 1fr;
      place-items: stretch;
      gap: 1rem;
      padding-bottom: 1rem;
    	position: relative;

      .description {
        font-size: var(--font-size-description, 2rem);
        grid-column: 1;
        grid-row: 1;
        position: relative;
        max-width: var(--box-max-width, 500px);
        place-self: end;

        span {
          padding: 1rem;
          display: inline-block;
        	background: var(--color-accent);	
        }

        /* triangle */
        &:after {
          content: '';
          width: 0; 
          height: 0; 
          top: calc(50% - 5px);
          border-top: 5px solid transparent;
          border-bottom: 5px solid transparent;
          border-left: 5px solid var(--color-accent);
          position: absolute;
        }
      }

      svg {
        grid-column: 2;
        grid-row: 1;
      }
      .date {
        font-size: var(--font-size-date, 1rem);
        font-weight: 700;
        display: flex;
  			align-items: center;
      }

    	/* vertical line */
    	&:after {
        content: '';
        height: 100%;
        width: 2px;
        background: var(--color-accent);
        position: absolute;
        left: calc(50% - 2px);
        z-index: -1;
      }

      &:nth-child(even) {
        .description {
        	grid-column: 3;
        	text-align: left;
	        place-self: start;

          &:after {
            right: 100%;
            border-left: 0;
            border-right: 5px solid var(--color-accent);
          }
        }
        .date {
          grid-column: 1;
					place-self: end;
          align-self: center;
        }
      }

    	&:first-child {
        &:after {
          top: 50%;
        }
      }
    	&:last-child {
        &:after {
          bottom: 50%;
        }
      }
    }
  }
}

